      if (firstChar === '0') {
        console.log("不跳转");
        return;
      }
      // URL
      if (firstChar === '1') {
        console.log("跳转URL", link);
        uni.navigateTo({
          url: link
        });
      }
      // APP功能页
      if (firstChar === '2') {
        console.log("功能页", link);
        // 圈子，快讯
        if (link === "10") {
          uni.setStorageSync('tabIndex', 0);
          uni.switchTab({
            url: '/pages/club/club'
          });
        }
        //圈子，拼车
        if (link === "11") {
          uni.setStorageSync('tabIndex', 1);
          uni.switchTab({
            url: '/pages/club/club'
          });
        }
        //圈子，拼房
        if (link === "12") {
          uni.setStorageSync('tabIndex', 2);
          uni.switchTab({
            url: '/pages/club/club'
          });
        }
        //圈子，捡漏
        if (link === "13") {
          uni.setStorageSync('tabIndex', 3);
          uni.switchTab({
            url: '/pages/club/club'
          });
        }
        // 活动
        if (link == "2") {
          uni.switchTab({
            url: '/pages/active/active'
          });
        }
        // 教练
        if (link === "3") {
          // uni.switchTab({
          // 	url: '/pages/teacher/teacherIndex'
          // });
          this.moreTeacher();
        }
        // 我的
        if (link === "4") {
          uni.switchTab({
            url: '/pages/me/me'
          });
        }
        // 雪票
        if (link === "5") {
          uni.switchTab({
            url: '/pages/ticket/ticketIndex'
          });
        }
      }
      // 内容聚合页
      if (firstChar === '3') {
        console.log("内容聚合页", link);
        // 攻略
        if (link === "1") {
          uni.navigateTo({
            url: '/pages/article/strategyIndex'
          });
        }
        // 吃喝
        if (link == "2") {
          uni.navigateTo({
            url: '/pages/article/eat-drink-Index'
          });
        }
        // 推荐
        if (link === "3") {
          uni.navigateTo({
            url: '/pages/article/reco-Index'
          });
        }
      }
      // 指定文章
      if (firstChar === '4') {
        console.log("指定文章", link);
        uni.navigateTo({
          url: '/pages/article/articleInfo?id=' + link
        });
      }
